import unittest
import os
import uuid
from unittest.mock import patch, MagicMock
from flask import json
from app import create_app
from datetime import datetime
from sqlalchemy.exc import IntegrityError

class TestAddPayment(unittest.TestCase):
    def setUp(self):
        """Configura la aplicaci√≥n de prueba."""
        os.environ["TESTING"] = "true"
        self.app = create_app()
        self.app.testing = True
        self.client = self.app.test_client()
        self.app_context = self.app.app_context()
        self.app_context.push()

        self.valid_order_id = str(uuid.uuid4())
        self.valid_receipt_image = ""
        self.valid_payment_data = {
            "order_id": self.valid_order_id,
            "receipt_image": self.valid_receipt_image
        }

    def tearDown(self):
        """Elimina el contexto de la aplicaci√≥n despu√©s de cada prueba."""
        self.app_context.pop()

    @patch('views.add_payment.extract_amount_from_image')
    @patch('views.add_payment.db')
    @patch('views.add_payment.Order')
    @patch('views.add_payment.Payments')
    def test_add_payment_success(self, mock_Payments, mock_Order, mock_db, mock_extract_amount):
        test_order_id = uuid.uuid4()
        test_payment_amount = 50.0

        mock_extract_amount.return_value = test_payment_amount

        mock_order = MagicMock()
        mock_order.id = test_order_id
        mock_order.status = "Pendiente"
        mock_order.order_total = 100.0
        mock_Order.query.get.return_value = mock_order

        mock_session = MagicMock()
        mock_session.query.return_value.filter.return_value.scalar.return_value = 30.0
        mock_db.session = mock_session

        mock_payment_instance = MagicMock()
        mock_payment_instance.id = uuid.uuid4()
        mock_payment_instance.payment = test_payment_amount
        mock_payment_instance.balance = 20.0
        mock_payment_instance.payment_date = datetime(2025, 5, 10)

        mock_Payments.query.filter_by.return_value.order_by.return_value.all.return_value = [mock_payment_instance]

        mock_Payments.return_value = mock_payment_instance

        payload = {
            "order_id": str(test_order_id),
            "receipt_image": "base64stringdummy=="
        }

        response = self.client.post(
            "/order/add_payment",
            data=json.dumps(payload),
            content_type='application/json'
        )

        self.assertEqual(response.status_code, 201)
        data = json.loads(response.data)

        self.assertEqual(data["order_id"], str(test_order_id))
        self.assertEqual(data["current_payment"], test_payment_amount)
        self.assertEqual(data["total_paid"], 80.0)
        self.assertEqual(data["remaining_balance"], 20.0)
        self.assertEqual(data["order_status_payment"], "partial payment")
        self.assertIn("payment_history", data)

    def test_add_payment_missing_fields(self):
        """Prueba cuando faltan campos obligatorios."""
        response = self.client.post(
            "/order/add_payment",
            data=json.dumps({"order_id": self.valid_order_id}),
            content_type="application/json"
        )
        self.assertEqual(response.status_code, 400)
        self.assertIn("Missing required fields: receipt_image", response.json["message"])

        response = self.client.post(
            "/order/add_payment",
            data=json.dumps({"receipt_image": self.valid_receipt_image}),
            content_type="application/json"
        )
        self.assertEqual(response.status_code, 400)
        self.assertIn("Missing required fields: order_id", response.json["message"])

    def test_add_payment_invalid_uuid(self):
        """Prueba cuando el order_id no es un UUID v√°lido."""
        invalid_data = {
            "order_id": "not-a-valid-uuid",
            "receipt_image": self.valid_receipt_image
        }
        response = self.client.post(
            "/order/add_payment",
            data=json.dumps(invalid_data),
            content_type="application/json"
        )
        self.assertEqual(response.status_code, 400)
        self.assertIn("ID de orden inv√°lido", response.json["message"])

    @patch("views.add_payment.Order")
    def test_add_payment_order_not_found(self, mock_order_class):
        """Prueba cuando la orden no existe."""
        mock_order_class.query.get.return_value = None

        response = self.client.post(
            "/order/add_payment",
            data=json.dumps({
                "order_id": str(uuid.uuid4()),
                "receipt_image": "base64dummy=="
            }),
            content_type="application/json"
        )
        
        self.assertEqual(response.status_code, 404)
        self.assertIn("Orden no encontrada", response.json["message"])

    @patch("views.add_payment.Order")
    def test_add_payment_order_already_paid(self, mock_order_class):
        """Prueba cuando la orden ya est√° pagada."""

        mock_order = MagicMock()
        mock_order.status_payment = "paid"
        mock_order_class.query.get.return_value = mock_order

        response = self.client.post(
            "/order/add_payment",
            data=json.dumps({
                "order_id": str(uuid.uuid4()),
                "receipt_image": "base64dummy=="
            }),
            content_type="application/json"
        )

        self.assertEqual(response.status_code, 400)